[Term]
id: MOD:00793
name: dehydroalanine (Cys)
def: "A protein modification that effectively converts an L-cysteine residue to dehydroalanine (not known as a natural, post-translational modification process)." [DeltaMass:8, PMID:15799070, PubMed:10220322, PubMed:11212008, PubMed:1547888, PubMed:1815586, PubMed:2914619, PubMed:7947813, PubMed:8239649, UniMod:368]
comment: In an attempt to clarfiy the difference between the modification of cysteine to lanthionine and cysteine to dehydroalanine, the following contributions from the ABRF email forum are presented:Structurally speaking lanthionine is like cystine but lacks one S atom. I imagine one can think of it as a condensation of cysteine and dehydroalanine but I do not know how it is made biologically. Dehydroalanine could be derived from either serine or cysteine. If I recall Biochem 101 correctly lanthionine was first found in wool.-Lowell Ericsson (ERICSSONLH@U.WASHINGTON.EDU)As far as I know, the structure of lanthionine is two Ala's joined by a single sulphur with the loss of two hydrogens from the methyl group of the Ala.Stephen Bayne (sbay@novo.dk)Regarding the structure of lanthionine and dehydroalanine: dehydroalanine is formed by the loss of one sulfur atom and two hydrogen atoms from ONE cysteine residue. lanthionine is formed from TWO cysteines, is a thioether, and contains one sulfur atom less than the amino acid cystine. Dan McCormick (MCCORMICK@rcf.mayo.edu) [DeltaMass]. All known batcterially produced lanthionine crosslinks are made by dehydration of L-serine to dehydroalanine, and then reaction with L-cysteine so as to produce chiral inversion at the alpha-carbon of the original L-serine; the lanthionine is a meso-diastereomer with L-configuration of the original cysteine alpha-carbon and D-configuration of the original L-serine alpha-carbon. Dehydroalanine is not known to be produced naturally by loss of hydrogen sulfide from cysteine. Beta-elimination of hydrogen sulfide does occur during treatment with performic acid [JSG].
synonym: "Cys->Dha" RELATED PSI-MS-label []
synonym: "Dehydroalanine (from Cysteine)" EXACT DeltaMass-label []
synonym: "Dehydroalanine (from Cysteine)" RELATED UniMod-description []
synonym: "dHAla(Cys)" EXACT PSI-MOD-label []
